('2405','18','7926','Dino Bertorelli',Null,'Einfamilienhaus im Bungalow Stil in Santa Ponsa zu verkaufen','33794','Das Haus steht auf einem ca 1.100m² großen Grundstück in einer ruhigen Wohnlage. Die ca 290m² Wohnfläche verteilt sich auf Wohn-Esszimmer, grosse Küche, Hauswirtschaftsraum, 4 Schlafzimmer und 3 Badezimmer. Eine Ölzentralheizung und eine Klimaanlage im Wohnzimmer sorgen ganzjährig für ein angenehmes Wohnklima. Im flache Garten mit mediterranen Pflanzen und einem Pool kann man entspannen. In nur wenigen Fahrminuten erreicht man den Ortskern von Santa Ponsa, 2 Marinas und mehrere Golfplätze','33795','785000','106','2015-12-03 12:08:17','106','2015-12-03 12:13:06',Null,'2525','121','1185',1,'1','0',Null,Null,Null,'33796',Null,'0','0','0',Null,'2015-12-03 12:22:15',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33797',Null,'33798',Null,'33799',Null,'33800','616 414 252','33801','0',0,'0');
